import React from 'react'

export default function Contact(){
    return(
        <div className="App">
            <header className="App-header">
                Terhubung dengan saya di :
                <a href="https://www.linkedin.com/in/ucims"><i class="fa fa-linkedin"></i>Uci Muhamad Sanusi</a>

            </header>
        </div>
    )
}
